import React from 'react';
import { Link } from 'react-router-dom';

function Navigation() {
    return (
        <div style={styles.navbar}>
            <Link to="/" style={styles.link}>Home</Link>
            <Link to="/register" style={styles.link}>Reviews</Link>
            <Link to="/products" style={styles.link}>Cart</Link>
        </div>
    );
}

const styles = {
    navbar: {
        display: 'flex',
        justifyContent: 'space-around',
        alignItems: 'center',
        backgroundColor: '#333',
        padding: '10px 0',
        position: 'fixed',
        top: 0,
        width: '100%',
        boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
        zIndex: 1000,
    },
    link: {
        color: 'white',
        textDecoration: 'none',
        fontSize: '18px',
        padding: '10px 20px',
        transition: 'background-color 0.3s',
    },
    linkHover: {
        backgroundColor: '#555',
    }
};

export default Navigation;
